import React from 'react'
import Goals from './Goals'

export default function GoalContainer(props) {

    const renderGoals = props.goalArr.map((goals, index) => {
        return <Goals key={goals.id} name={goals.name} start_date={goals.start_date} end_date={goals.end_date} />
    })

    const renderRows = props.goalArr.map((goals) => (
        <tbody>
            <td>{goals.name}</td>
        </tbody>

    ))

    // console.log(props)
    return (
        <div>
            <br></br>

            <strong>{props.categoryName}</strong>
            <table>
                <tr>
                    <td>Goal</td>
                    <td>Start Date</td>
                    <td>End Date</td>
                    <td>Edit</td>
                    <td>Delete</td>
                 </tr>
                 <td>{renderGoals}</td>
            </table>

        </div>
    )
}
